import React, { Component } from 'react'
import villiansData from '../src/data/joker.json'

const members = villiansData.results[0].members
const villians = members.filter(member => member.intelligence === '100')


class Villians extends Component {
    render() {
        return (
            <div>
                <h1>{members.length} Villians</h1>
                <h2>Intelligence: {villians.length}</h2>
            </div>

        )

    }



}

export default Villians
